        <thead>
            <tr>
                <th>Id</th>
                <th>Email</th>
                <th>Roles</th>
                <th>Password</th>
                <th>Nom</th>
                <th>Prenom</th>
                <th>actions</th>
            </tr>
        </thead>
        <tbody>
        {% for team in teams %}
            <tr>
                <td>{{ team.id }}</td>
                <td>{{ team.email }}</td>
                <td>{{ team.roles ? team.roles|json_encode : '' }}</td>
                <td>{{ team.password }}</td>
                <td>{{ team.nom }}</td>
                <td>{{ team.prenom }}</td>
                <td>
                    <a href=\"{{ path('app_team_show', {'id': team.id}) }}\">show</a>
                    <a href=\"{{ path('app_team_edit', {'id': team.id}) }}\">edit</a>
                </td>
            </tr>
